Калибровка монитора состоит из нескольких шагов (на некоторых мониторах определенные шаги могут отсутствовать):

• регулировка яркости и контрастности монитора;
• определение кривой отклика штатной яркости монитора;
• выбор желаемой гаммы кривой отклика;
• выбор желаемой белой точки (более теплый или холодный тон белого цвета).

A calibragem do monitor envolve vários passos:
(alguns podem ser ignorados em alguns monitores)

• Ajuste o brilho e o contraste do monitor;
• Determine a curva de resposta da luminância nativa do monitor;
• Escolha um gama da curva de resposta;
• Escolha um ponto branco (calidez ou frieza do branco).
